import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with more robust waiting
    await page.goto(fileUrl);
    await page.waitForSelector('body', { timeout: 5000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input using multiple selector strategies
    const searchInput = await page.waitForSelector('input#searchInput', { timeout: 5000 });

    // Inject XSS payload into search input
    const xssPayload = '<script>alert("XSS")</script>';
    await searchInput.fill(xssPayload);

    // Take screenshot after input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click search button using class selector
    const searchButton = await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await searchButton.click();

    // Wait briefly for potential XSS execution
    await page.waitForTimeout(1000);

    // Take screenshot after search execution
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if XSS might have executed by examining page content
    const pageContent = await page.content();
    const xssDetected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: " + xssPayload,
      extractedData: {
        xssPayload: xssPayload,
        xssDetectedInResponse: xssDetected,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
